import React from 'react'
import { connect } from 'react-redux'
import { Link } from 'react-router-dom'

class ScoreTable extends React.Component{
    render(){
        const { doneTasks } = this.props
        return(
            <table>
                <tr>
                    <th>Id</th>
                    <th>Task name</th>
                    <th>Start time</th>
                    <th>Stop time</th>
                    <th>Duration</th>
                </tr>
                {doneTasks.map(elem => <tr>
                    <td>{elem.id}</td>
                <td><Link to={`/taid=${elem.id}`}>{elem.name}</Link></td>
                    <td>{elem.startTime.hours}:{elem.startTime.minutes}</td>
                    <td>{elem.stopTime.hours}:{elem.stopTime.minutes}</td>
                    <td>{elem.duration}s</td>
                </tr>)}
            </table>
        )
    }
}

const mapStateToProps = state => {
    return {
        doneTasks: state.doneTasks
    }
}

export default connect(mapStateToProps)(ScoreTable)
